import './App.css';
import AddCostPage from './addcost.js'
import GetReportPage from "./report";
import AboutPage from "./about";
import ResponsiveAppBar from './components/Table.js'
import React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


const App = () => {
    return (
        <Router>
            <ResponsiveAppBar />
            <Routes>
                <Route path='/' exact component={AddCostPage} />
                <Route path='/report' exact component={GetReportPage} />
            </Routes>
        </Router>
    );
}

export default App;
